import { useState, useEffect } from "react";
import { useParams, useNavigate } from "react-router-dom";
import Container from "@mui/material/Container";
import Card from "@mui/material/Card";
import MKBox from "components/MKBox";
import MKTypography from "components/MKTypography";
import CircularProgress from "@mui/material/CircularProgress";
import Alert from "@mui/material/Alert";
import PlayerRegistrationForm from "components/Forms/PlayerRegistrationForm";
import SponsorRegistrationForm from "components/Forms/SponsorRegistrationForm";

function SignupWithToken() {
  const { token } = useParams();
  const navigate = useNavigate();
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState("");
  const [tokenData, setTokenData] = useState(null);

  useEffect(() => {
    const verifyToken = async () => {
      try {
        console.log("Verifying token:", token); // Debug log
        setIsLoading(true);
        setError("");

        if (!token) {
          throw new Error("No registration link provided");
        }

        console.log("Making API request to:", `https://x8ki-letl-twmt.n7.xano.io/api:LfeuGUZr/kbflinks/${token}`); // Debug log

        const response = await fetch(
          `https://x8ki-letl-twmt.n7.xano.io/api:LfeuGUZr/kbflinks/${token}`,
          {
            method: "GET",
            headers: {
              "Content-Type": "application/json",
            }
          }
        );

        console.log("API Response status:", response.status); // Debug log

        if (!response.ok) {
          const errorData = await response.json().catch(() => ({}));
          console.error("API Error:", errorData); // Debug log
          throw new Error(errorData.message || "Invalid or expired link");
        }

        const data = await response.json();
        console.log("API Response data:", data); // Debug log

        // Check if we have the necessary data
        if (!data || !data.type) {
          throw new Error("Invalid response from server");
        }

        // Check if the link has been used
        if (data.used) {
          throw new Error("This registration link has already been used");
        }

        // Check if the link has expired (if there's an expiry field)
        if (data.expiry && new Date(data.expiry) < new Date()) {
          throw new Error("This registration link has expired");
        }

        setTokenData({
          type: data.type,
          id: token // Use the token as the ID since that's what we're passing in the URL
        });
      } catch (err) {
        console.error("Verification Error:", err); // Debug log
        setError(err.message || "An error occurred while verifying the link");
        // Redirect to home page after 5 seconds if token is invalid
        setTimeout(() => navigate("/"), 5000);
      } finally {
        setIsLoading(false);
      }
    };

    verifyToken();
  }, [token, navigate]);

  // Debug render information
  console.log("Render state:", { isLoading, error, tokenData });

  if (isLoading) {
    return (
      <MKBox
        display="flex"
        justifyContent="center"
        alignItems="center"
        minHeight="100vh"
      >
        <CircularProgress />
      </MKBox>
    );
  }

  if (error) {
    return (
      <Container maxWidth="sm">
        <MKBox mt={6}>
          <Alert severity="error" sx={{ mb: 2 }}>
            {error}
          </Alert>
          <MKTypography variant="body2" textAlign="center">
            Redirecting to home page...
          </MKTypography>
        </MKBox>
      </Container>
    );
  }

  if (!tokenData) {
    return (
      <Container maxWidth="sm">
        <MKBox mt={6}>
          <Alert severity="error" sx={{ mb: 2 }}>
            Unable to load registration form. Please try again.
          </Alert>
          <MKTypography variant="body2" textAlign="center">
            Redirecting to home page...
          </MKTypography>
        </MKBox>
      </Container>
    );
  }

  return (
    <Container maxWidth="lg">
      <MKBox
        minHeight="100vh"
        width="100%"
        sx={{
          backgroundImage: ({ functions: { linearGradient, rgba }, palette: { gradients } }) =>
            `${linearGradient(
              rgba(gradients.dark.main, 0.6),
              rgba(gradients.dark.state, 0.6)
            )}, url(https://raw.githubusercontent.com/creativetimofficial/public-assets/master/material-design-system/assets/img/city-profile.jpg)`,
          backgroundSize: "cover",
          backgroundPosition: "center",
          display: "grid",
          placeItems: "center",
        }}
      >
        <Card
          sx={{
            p: 4,
            mx: { xs: 2, lg: 3 },
            mt: 8,
            mb: 8,
            backgroundColor: ({ palette: { white }, functions: { rgba } }) => rgba(white.main, 0.8),
            backdropFilter: "saturate(200%) blur(30px)",
            boxShadow: ({ boxShadows: { xxl } }) => xxl,
          }}
        >
          <MKBox px={3} pb={3} textAlign="center">
            <MKTypography variant="h3" mb={1}>
              {tokenData?.type === "player" ? "Player Registration" : "Sponsor Registration"}
            </MKTypography>
            <MKTypography variant="body2" color="text">
              Please fill in your details below
            </MKTypography>
          </MKBox>

          {tokenData?.type === "player" ? (
            <PlayerRegistrationForm token={token} linkId={tokenData.id} />
          ) : (
            <SponsorRegistrationForm token={token} linkId={tokenData.id} />
          )}
        </Card>
      </MKBox>
    </Container>
  );
}

export default SignupWithToken;
